import React from 'react';
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";

const CardAdder = () => {
  const createCard = () => {
    console.log('click');
  };

  return (
    <a className="card hover-card addButton" onClick={()=> createCard()}>
      <span id="add-text">
        <FontAwesomeIcon icon={['fas', 'plus-circle']} size="2x"/>
        <p>Add City</p>
      </span>
    </a>
  )
}
